var tc;
var tb;
var link_style = 'font-family:Arial;font-size:12px;color:black;';
var comment_style = 'font-family:Arial;font-size:12px;color:gray;';
var button_style = 'font-family:Arial;font-size:16px;color:gray;padding:4px;text-decoration:none;';

// these are the prefixes for the card/board ids we store in localStorage
//
var ignored_card_namespace = 'mycl-ignore-card-';
var ignored_board_namespace = 'mycl-ignore-board-';



function toggle_ignore(key){
    if (window.localStorage[key] === "yes") {
        window.localStorage[key] = "no";
    } else {
        window.localStorage[key] = "yes";
    }
}
function get_first_undone_checklist_item(checklist_object){
    checklist_name = '';
    checkitem_name = '';
    if (checklist_object.length > 1){
        //console.log(checklist_object);
    }

    sorted_checklist = _.sortBy(checklist_object, function(a){ return a.pos;});
    if (checklist_object.length > 1){
        //console.log(sorted_checklist);
    }
    for (var xx = 0; xx < sorted_checklist.length;xx++){
        checklist_name = sorted_checklist[xx].name;
        sorted_checkitems = _.sortBy( sorted_checklist[xx].checkItems,function(a){ return a.pos;});
        for (var yy = 0; yy < sorted_checkitems.length;yy++){
            checkitem_name = sorted_checkitems[yy].name;
            if (sorted_checkitems[yy].state === 'incomplete'){
                // found the first undone checklist item
                return_value =  " > " + checklist_name + " > " + checkitem_name;
                return return_value;
            }
        }
    }
    return "";
}

function is_ignored(key){
    return (window.localStorage[key] === "yes");
}

function isBoardIgnored(board) {
  return (is_ignored(ignored_board_namespace + board.id));
}

function isBoardIgnoredById(boardId) {
  return (is_ignored(ignored_board_namespace + boardId));
}

function isCardIgnored(card) {
  return (is_ignored(ignored_card_namespace + card.id));
}

/* For a given date, get the ISO week number
 *
 * Based on information at:
 *
 *    http://www.merlyn.demon.co.uk/weekcalc.htm#WNR
 *
 * Algorithm is to find nearest thursday, it's year
 * is the year of the week number. Then get weeks
 * between that date and the first day of that year.
 *
 * Note that dates in one year can be weeks of previous
 * or next year, overlap is up to 3 days.
 *
 * e.g. 2014/12/29 is Monday in week  1 of 2015
 *      2012/1/1   is Sunday in week 52 of 2011
 */
function getWeekNumber(d) {
    // Copy date so don't modify original
    d = new Date(+d);
    d.setHours(0,0,0,0);
    // Set to nearest Thursday: current date + 4 - current day number
    // Make Sunday's day number 7
    d.setDate(d.getDate() + 4 - (d.getDay()||7));
    // Get first day of year
    var yearStart = new Date(d.getFullYear(),0,1);
    // Calculate full weeks to nearest Thursday
    var weekNo = Math.ceil(( ( (d - yearStart) / 86400000) + 1)/7);
    // Return array of year and week number
    return [d.getFullYear(), weekNo];
}

function getElementForBoard(b) {
  // body...
  var heading = $('<div>').attr('boardid',b.id);
  var heading_text = $('<a>').attr('style','font-size:small').attr('href',b.url).click(function (evt) {
    evt.preventDefault();
    window.location = b.url;
  }).text(b.name).appendTo(heading);
  $('<span>').text('x').addClass('ignore-button').attr({'onclick':'toggle_ignore("' + (ignored_board_namespace + b.id)  + '");$(this).parent().remove();'}).insertAfter(heading_text);
  return heading;
}

function getElementForCard(card) {
    var heading = $('<div>').attr('style','flex: 1; order:' + (Date.parse(card.dateLastActivity)));
    $('<a>').attr({'style':link_style,'href':card.boardUrl}).click(function (evt) {
      evt.preventDefault();
      window.location = card.boardUrl;
    }).text(card.boardName).appendTo(heading);
    $('<span>').attr('style',link_style).text(' > ' + card.listName + ' > ').appendTo(heading);
    $('<a>').attr({'style':link_style,'href':card.url}).click(function (evt) {
      evt.preventDefault();
      window.location = card.url;
    }).text(card.name).appendTo(heading);
    if (card.checklists.length > 0){
        checklist_text = get_first_undone_checklist_item(card.checklists);
        $('<span>').attr('style',link_style).text(checklist_text).appendTo(heading);
    }
    $('<span>').text(" (" + moment(card.dateLastActivity).fromNow() + ")")
    .attr('style',comment_style)
    .appendTo(heading);

    $('<span>').text('x')
    .addClass('ignore-button')
    .attr({style:button_style,'onclick':'toggle_ignore("' + (ignored_card_namespace + card.id)  + '");$(this).parent().remove();'})
    .appendTo(heading);
    return heading;
}

function isInDoneList(card) {
  var listName = card.listName;
  return (_.indexOf(listName.toLowerCase().split(' '),'complete') > -1
  || _.indexOf(listName.toLowerCase().split(' '),'done') > -1
  || _.indexOf(listName.toLowerCase().split(' '),'pending') > -1 
)
}

function getCardStatus(card) {
  if (isCardIgnored(card)){
    return 'IGNORED';
  } else if (isInDoneList(card)) {
    return 'DONE';
  } else {
    return 'MINE';
  }
}

